import React from "react";
import Collapsible from 'react-collapsible';

function ProductMoreInfo({ prod, type }) {
    switch (type) {
        case 'diet-korm': {
            return (
                <div className="moreInfo">
                    {prod &&
                        <>
                            <Collapsible trigger="Бренд">
                                {`${prod.brand}`}
                            </Collapsible>
                            <Collapsible trigger="Страна">
                                {`${prod.country}`}
                            </Collapsible>
                            <Collapsible trigger="Описание">
                                {`${prod.Feed.description}`}
                            </Collapsible>
                            <Collapsible trigger="Фасовка">
                                {`${prod.Feed.weight} кг`}
                            </Collapsible>
                            <Collapsible trigger="Возраст питомца">
                                {`${prod.Feed.petAge}`}
                            </Collapsible>
                            <Collapsible trigger="Вкус">
                                {`${prod.Feed.flavour}`}
                            </Collapsible>
                            <Collapsible trigger="Класс корма">
                                {`${prod.Feed.classification}`}
                            </Collapsible>
                            <Collapsible trigger="Состав">
                                {`Состав: ${prod.Feed.composition}`}
                            </Collapsible>
                        </>
                    }
                </div>
            );
        }
        case 'korm': {
            return (
                <div className="moreInfo">
                    {prod &&
                        <>
                            <Collapsible trigger="Бренд">
                                {`${prod.brand}`}
                            </Collapsible>
                            <Collapsible trigger="Страна">
                                {`${prod.country}`}
                            </Collapsible>
                            <Collapsible trigger="Описание">
                                {`${prod.Feed.description}`}
                            </Collapsible>
                            <Collapsible trigger="Фасовка">
                                {`${prod.Feed.weight} кг`}
                            </Collapsible>
                            <Collapsible trigger="Возраст питомца">
                                {`${prod.Feed.petAge}`}
                            </Collapsible>
                            <Collapsible trigger="Вкус">
                                {`${prod.Feed.flavour}`}
                            </Collapsible>
                            <Collapsible trigger="Класс корма">
                                {`${prod.Feed.classification}`}
                            </Collapsible>
                            <Collapsible trigger="Состав">
                                {`Состав: ${prod.Feed.composition}`}
                            </Collapsible>
                        </>
                    }
                </div>
            );
        }
        case 'soderzhanie-i-ukhod': {
            if (prod.Bowl) {
                return (
                    <div className="moreInfo">
                        {prod &&
                            <>
                                <Collapsible trigger="Бренд">
                                    {`${prod.brand}`}
                                </Collapsible>
                                <Collapsible trigger="Страна">
                                    {`${prod.country}`}
                                </Collapsible>
                                <Collapsible trigger="Описание">
                                    {`${prod.Bowl.description}`}
                                </Collapsible>
                                <Collapsible trigger="Возраст питомца">
                                    {`${prod.Bowl.petAge}`}
                                </Collapsible>
                                <Collapsible trigger="Материал">
                                    {`${prod.Bowl.material}`}
                                </Collapsible>
                            </>}
                    </div>
                )
            }
            else if (prod.Bed) {
                return (
                    <div className="moreInfo">
                        {prod &&
                            <>
                                <Collapsible trigger="Бренд">
                                    {`${prod.brand}`}
                                </Collapsible>
                                <Collapsible trigger="Страна">
                                    {`${prod.country}`}
                                </Collapsible>
                                <Collapsible trigger="Описание">
                                    {`${prod.Bed.description}`}
                                </Collapsible>
                                <Collapsible trigger="Состав">
                                    {`Состав: ${prod.Bed.composition}`}
                                </Collapsible>
                            </>}
                    </div>
                )
            }
            else if (prod.Toy) {
                return (
                    <div className="moreInfo">
                        {prod &&
                            <>
                                <Collapsible trigger="Бренд">
                                    {`${prod.brand}`}
                                </Collapsible>
                                <Collapsible trigger="Страна">
                                    {`${prod.country}`}
                                </Collapsible>
                                <Collapsible trigger="Описание">
                                    {`${prod.Bed.description}`}
                                </Collapsible>
                                <Collapsible trigger="Состав">
                                    {`Состав: ${prod.Bed.composition}`}
                                </Collapsible>
                            </>}
                    </div>
                )
            }
        }
        case 'aquariums': {
        }
        case 'veterinary': {
        }
    }
}

export default ProductMoreInfo;
